  const VERTICAL_CLASS = 'vertical';
  const Y_AXIS_LABEL_CLASS = 'y-axis-label';
  const X_AXIS_LABEL_CLASS = 'x-axis-label';
  const CUSTOM_BRUSH_HANDLE_CLASS = 'custom-brush-handle';
  const DEFAULT_AXIS_LABEL_PADDING = 12;

